_body: !!python/object:github.GithubObject._ValuedAttribute
  value: "not sur about the fix \r\nwarning is : \r\n````\r\n../../libraries/AP_ADSB/AP_ADSB.cpp:\
    \ In member function \u2018uint8_t AP_ADSB::get_encoded_callsign_null_char()\u2019\
    :\r\n../../libraries/AP_ADSB/AP_ADSB.cpp:594:9: warning: \u2018snprintf\u2019\
    \ output truncated before the last format character [-Wformat-truncation=]\r\n\
    \ uint8_t AP_ADSB::get_encoded_callsign_null_char()\r\n         ^~~~~~~\r\n../../libraries/AP_ADSB/AP_ADSB.cpp:642:13:\
    \ note: \u2018snprintf\u2019 output between 5 and 6 bytes into a destination of\
    \ size 4\r\n     snprintf(out_state.cfg.callsign, 4, \"%04d\", unsigned(out_state.cfg.squawk_octal));\r\
    \n\r\n````\r\nI think it complain because will only give a size of 4 and it need\
    \ to put the \\0 at the end of the snprintf ? \r\n"
